import React from 'react'
import Link from 'next/link'

function Index() {
    return (
        <div>
            <nav>
                <Link href="/"><a>Westfield Web</a></Link>
            </nav>
            <h1>Index!!!!</h1>
        </div>
    )
}

export default Index


/* 
NOTES: Link provides an onClick function around whatever it's wrapping
